import React from 'react'
import styles from './Header.module.css';

export default function Header() {
    return (
        <div className={ styles.container }>
            <div className={ styles.brand }>HELSINGIN SANOMAT</div>
            <div style={{ color: 'white' }}>Etusivu</div>
            <div style={{ color: 'white' }}>Uutiset</div>
            <div style={{ color: 'white' }}>Lehdet</div>
            <div style={{ color: 'white' }}>Asiakaspalvelu</div>
            <div style={{ color: 'white' }}>Tilaa
            Kirjaudu
            Valikko</div>

        </div>
    )
}
